    user_id INT,
    search_timestamp TIMESTAMP
);

CREATE TABLE Users (
    user_id INT PRIMARY KEY,
    username TEXT,
    email TEXT,
    registration_date DATE
);

CREATE TABLE UserBehavior (
    behavior_id INT PRIMARY KEY,
